(function(angular){"use strict";angular.module("oc.lazyLoad").config(["$provide",function($provide){$provide.decorator("$ocLazyLoad",["$delegate","$q",function($delegate,$q){$delegate.cssLoader=function(paths,callback,params){var promises=[];angular.forEach(paths,function(path){promises.push($delegate.buildElement("css",path,params))});$q.all(promises).then(function(){callback()},function(err){callback(err)})};$delegate.cssLoader.ocLazyLoadLoader=true;return $delegate}])}])})(angular);